  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is a single orthophoto from
  a collection of GeoTIFF format natural color orthophotos covering the St. Johns
  River Water Management District. An orthophoto is remotely sensed image data in
  which displacement of features in the image caused by terrain relief and sensor
  orientation have been mathematically removed. Orthophotography combines the image
  characteristics of a photograph with the geometric qualities of a map. Each orthophoto
  provides imagery for a nominal 3.75 minute (in latitude and longitude) cell area.
  The source imagery was obtained from December 2003 to March 2004 and used to produce
  orthophotos with a one meter ground resolution. Imagery was acquired at 0.62 meter
  ground sample distance (GSD) resolution. Flight height maintained during mission
  was 20,000 feet AGL. The imagery was captured at 12-bit radiometric resolution and
  converted to 8-bit radiometric resolution during post processing. The imagery was
  captured with 20% sidelap between all adjacent flight lines. The SJRWMD project
  area was divided into 5 flight blocks due to necessary base station and flight line
  length requirements. The imagery was obtained and processed by all digital means
  beginning with data acquisition using a Leica ADS40 Digital Airborne Sensor. The
  orthophotos are available in GeoTIFF form. The projected coordinate system is UTM
  zone 17 N, NAD 83 HARN, GRS 80, Units Meters.\",\n\t\"owner_org\": \"b0b4c45b-a8ca-416b-b463-ee90d0a1a3df\",\n\t\"extras\":
